import './App.css';
import './Reset.css';
import Header from "./components/Header/Header";
import Footer from "./components/Footer/Footer";
import Main from "./components/Main/Main";
import { BrowserRouter } from "react-router-dom";

const App = (props) => {
	let dialogs_data = [
		{'id': 1, 'name': 'Andrew'},
		{'id': 2, 'name': 'Dmitry'},
		{'id': 3, 'name': 'Sasha'},
		{'id': 4, 'name': 'Valera'},
		{'id': 5, 'name': 'Victor'},
		{'id': 6, 'name': 'Carl'},
		{'id': 7, 'name': 'Lera'},
		{'id': 8, 'name': 'Marat'},
		{'id': 9, 'name': 'Andrea'},
		{'id': 10, 'name': 'Vlad'},
	]

	return (
		<BrowserRouter>
			<div className='app-wrapper'>
				<Header/>
				<Main posts_data={ props.posts_data } dialogs_data={ dialogs_data }/>
				<Footer/>
			</div>
		</BrowserRouter>
	)
}


export default App;
